import axios from "axios";
import React from "react";
import { useState } from "react";

const AddSsd = () => {
  const [brand, setBrand] = useState("");
  const [model, setModel] = useState("");
  const [serialNumber, setSerialNumber] = useState("");
  const [size, setSize] = useState("");
  const [purchaseDate, setPurchaseDate] = useState("");
  const [purchasePrice, setPurchasePrice] = useState("");
  const [arrivalDate, setArrivalDate] = useState("");
  const [saleValue, setSaleValue] = useState("");

  const [productCategory, setProductCategory] = useState("");
  const [file, setFile] = useState("");

  const handleImage = (e) => {
    console.log(e.target.files);
    setFile(e.target.files[0]);
  };

  const handleChange = (e) => {
    setBrand(e.target.value);
    setModel(e.target.value);
    setSerialNumber(e.target.value);
    setSize(e.target.value);
    setPurchaseDate(e.target.value);
    setPurchasePrice(e.target.value);
    setArrivalDate(e.target.value);
    setSaleValue(e.target.value);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    // console.log(brand, model);

    const category = {
      productCategory,
    };

    const formData = new FormData();
    formData.append("file", file);
    formData.append("brand", brand);
    formData.append("model", model);
    formData.append("serialNumber", serialNumber);
    formData.append("size", size);
    formData.append("purchaseDate", purchaseDate);
    formData.append("purchasePrice", purchasePrice);
    formData.append("arrivalDate", arrivalDate);
    formData.append("saleValue", saleValue);

    try {
      const response = await axios({
        method: "post",
        url: "http://localhost:9090/ssd/new",
        data: formData,
        headers: { "Content-Type": "multipart/form-data" },
      });
      console.log(response.data);
    } catch (error) {
      console.log(error.response);
    }
  };

  return (
    <div className="meuForm">
      <div className="form-row">
        <form onSubmit={(e) => handleSubmit(e)}>
          <div className="col-md-6 offset-md-3">
            <input type="file" name="file" onChange={handleImage} />
          </div>

          <div className="col-md-6 offset-md-3">
            <input
              type={"brand"}
              name="brand"
              value={ssd.brand}
              className="form-control"
              placeholder="Brand"
              onChange={handleChange}
              // onChange={(e) => setBrand(e.target.value)}
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"model"}
              name="model"
              className="form-control"
              value={ssd.model}
              placeholder="Model"
              onChange={handleChange}
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"serialNumber"}
              name="serialNumber"
              className="form-control"
              value={ssd.serialNumber}
              placeholder="Serial Number"
              onChange={handleChange}
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"size"}
              name="size"
              className="form-control"
              value={ssd.size}
              placeholder="Size"
              onChange={handleChange}
            />
          </div>

          <div className="col-md-6 offset-md-3">
            <input
              type={"purchaseDate"}
              name="purchaseDate"
              className="form-control"
              value={ssd.purchaseDate}
              placeholder="Purcase date"
              onChange={handleChange}
            />
          </div>

          <div className="col-md-6 offset-md-3">
            <input
              type={"purchasePrice"}
              name="purchasePrice"
              className="form-control"
              value={ssd.purchasePrice}
              placeholder="Purchase price"
              onChange={handleChange}
            />
          </div>

          <div className="col-md-6 offset-md-3">
            <input
              type={"arrivalDate"}
              name="arrivalDate"
              className="form-control"
              value={ssd.arrivalDate}
              placeholder="Arrival date"
              onChange={handleChange}
            />
          </div>
          <div className="col-md-6 offset-md-3">
            <input
              type={"productCategory"}
              name="productCategory"
              className="form-control"
              value={productCategory}
              placeholder="Product category"
              onChange={handleChange}
            />
          </div>
          <div>
            <input
              type={"saleValue"}
              name="saleValue"
              value={ssd.saleValue}
              className="form-control"
              placeholder="saleValue"
              onChange={handleChange}
            />
          </div>

          <div className="col-md-6 offset-md-3">
            <button
              type="submit"
              className="btn btn-success"
              // onChange={(e) => this.handleSubmit(e)}
            >
              Salvar
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};
export default AddSsd;
